INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (2, 24001, 0, 1, 321, "リリ", 1, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 40011, 1, 125801);
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (2, 24001, 0, 2, 322, "クリア", 1, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 40011, 1, 126001);
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (2, 24001, 0, 3, 323, "プレシア", 1, "んーと。\nこれ、あげる。\nはい", 40011, 1, 126101);
