INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (2, 24001, 0, 5, 325, "クリア", 1, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 40011, 2, 126001);
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (2, 24001, 0, 6, 326, "プレシア", 1, "お兄。\nきてくれて、うれしい", 40011, 2, 126101);
